import React from 'react';
import  "../../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import './Content.css';
import img from '../../Images/Vector.png';
import Card from '../Cards/Card';
import WriteBox from '../Cards/WriteBox';
import dp1 from '../../Images/dp-1.png';
import dp2 from '../../Images/dp-2.png';
import dp3 from '../../Images/dp-3.png';
import dp4 from '../../Images/dp-4.png';
import img1 from '../../Images/img-1.png';
import img2 from '../../Images/img-2.png';
import img3 from '../../Images/img-3.png';
export default function Content(){

 const name=["‚úçÔ∏è Article","üî¨Ô∏è Education","üóìÔ∏è Meetup","üíºÔ∏è Job"];
 const title=["What if famous brands had regular fonts? Meet RegulaBrands!","Tax Benefits for Investment under National Pension Scheme launched by Government",
  "Finance & Investment Elite Social Mixer @Lujiazui","Software Developer"];
  const about=["I‚Äôve worked in UX for the better part of a decade. From now on, I plan to rei‚Ä¶",
"I‚Äôve worked in UX for the better part of a decade. From now on, I plan to rei‚Ä¶","",""];
  const dp=[dp1,dp2,dp3,dp4];
  const userName=["Sarthak Kamra","Sarah West","Ronal Jones","Joseph Gray"];
    return(
        <>
      <div className="main-content"> 
          <div className="horizontal">
             <div class="container">
               <span>All Posts(32)</span> 
               <div className="links">
               <a href="#">Article</a>
               <a href="#">Event</a>
               <a href="#">Education</a>
               <a href="#">Job</a>
                </div>
                <div className="btns">
                  <div className="post">
                    <p>Write a Post</p>
                    <svg width="10" height="5" viewBox="0 0 10 5" fill="none" xmlns="http://www.w3.org/2000/svg">
                     <path d="M0.416626 0.166626L4.99996 4.74996L9.58329 0.166626H0.416626Z" fill="black"/>
                    </svg>
                  </div>
                  <button class="btn btn-primary" type="submit">
                    <img src={img} alt="" />
                    Join Group</button>
                </div>
             </div>
           </div>
         <div className="vertical">
                  <div className="left">
                    <Card name={name[0]} title={title[0]} dp={dp[0]} user={userName[0]} img={img1}/>
                    <Card name={name[1]} title={title[1]} dp={dp[1]} user={userName[1]} img={img2}/>
                    <Card name={name[2]} title={title[2]} dp={dp[2]} user={userName[2]} img={img3}/>
                    <Card name={name[3]} title={title[3]} dp={dp[3]} user={userName[3]}/>
                  </div>
                  <div className="right">
                     <WriteBox />
                  </div>
                </div>
          </div>
       
        </>
    )
}
